import './App.css';
import Layout from './Components/Layout'
import Home from './Pages/HomePage/Home'


function App() {
  return (
    <Router>
      <Layout>
        <Route exact path='/' component={Home}/>
      </Layout>
    </Router>
  );
}

export default App;
